class Stack:
    stack = list()

    def __init__(self, stack):
        self.stack = stack

    def push(self, x):
        self.stack.append(x)

    def pop(self):
        if len(self.stack) != 0:
            return self.stack.pop()
        else:
            return '-1'

    def peek(self):
        if len(self.stack) != 0:
            return self.stack[-1]
        else:
            return '-1'

    def max_remove(self, s):
        count = 0
        stack_copy = self.stack[:]
        stack_copy.reverse()
        if s == 'Dee':
            for i in stack_copy:
                if i == '0':
                    count += 1
                else:
                    break
        elif s == 'Dum':
            for i in stack_copy:
                if i == '1':
                    count += 1
                else:
                    break
        return count

