def playDee(a, nq):
    b = []
    for i in range(nq):
        if a[i][0] == '0':
            b.append(i)
    if b == []:
        return -1
    n = len(b)
    for i in range(n):
        n1 = len(a[b[i]])
        for j in range(n1 - 1, 0, -1):
            if a[b[i]][j] == '1':
                a[b[i]] = a[b[i]][j:]
                return nq
    a.pop(b[0])
    nq -= 1
    return nq

